//  Однин из подключаемых компонентов

import React from "react"

class Users extends React.Component {
	users = [
		{
			id: 1,
			firstname: 'Lulu',
			lastname: 'Pinachet',
			bio: 'sovsem nitacoi kak vse',
			age: 40,
			isHappy: true
		},
		{
			id: 2,
			firstname: 'Balu',
			lastname: 'Zalupkin',
			bio: 'sovsem nitacoi kak vse i dashe bolhe',
			age: 23,
			isHappy: false
		}
	]
	render() {
		if ( this.users.length > 0 )
			return ( <div>
				{this.users.map( ( el ) => ( <div className="user" key={el.id}>
					<h3>{el.firstname} {el.lastname}</h3>
					<p>{el.bio}</p>
					<b></b>
				</div> ) )}
			</div> )
		else
			return ( <div className="user">
				<h3>Пользователей нет</h3>
			</div> )
	}
}

export default Users
